INSERT INTO `Events` VALUES (1,'2010-06-05','Mortons','Dinner Party','London','28 Berkeley Square','','Mayfair','W1J 6EN','28','8.00',65,'Morton\'s private members\' club is an impressive Georgian townhouse spanning over four floors with striking views over Berkeley Square.\r\n\r\nThis is the perfect venue to host our first dinner party where our members can meet and socialise over great food and wine. After dinner we will head downstairs to the Club to continue the evening.','Female Tickets Sold Out','mortons.jpg',3,0),(2,'2010-06-19','Home House','Networking Drinks','London','21 Portman Square','','London','W1H 6LW','28','8.00',25,'Home House is a former London abode of the Countess of Home and is exquisitely beautiful and has been lovingly restored to its former glory. An exclusive private members club in Central London, our Networking drinks at this venue always attracts a large crowd so please don\'t miss out on this event.','Female Tickets Sold Out','homehouse0.jpg',15,0),(4,'2010-07-16','The Yacht London','Summer Party','London','Temple Pier','','Victoria Embankment','WC2R 2PN','28','8.00',60,'Please join us for our summer party on board The Yacht London, a 1920s steam vessel moored at Temple Pier. Our members will enjoy canapes and complimentary drinks until 10pm after which you can network and socialise in either the stunning Art Deco cocktail lounge or the champagne bar on the top deck. This is the party not to be missed this summer so please book early to avoid disappointment.','Available','theyachtlondon.jpg',48,46),(3,'2010-07-24','Home House','Networking Drinks','London','21 Portman Square','','London','W1H 6LW','28','8.00',25,'Home House is an exclusive Private Member\'s Club behind Selfridges in Central London. This venue is perfect for socialsing and networking with other members. Don\'t miss out on a fun evening!','Event Sold Out','homehouse1.jpg',0,0),(5,'2010-08-19','Long bar @ Sanderson Hotel','Networking Drinks','London','50 Berners Street','','London','W1T 3NG','28','7.30',25,'Please join us for Networking drinks at the Long Bar, 80-feet long bar at the celebrity hotel, the Sanderson Hotel. Thisbar always attracts a glamorous crowd so we hope you can also join us and socialise and network with other single asian professionals. A complimentary glass of wine will be offered to those who arrive early between 7.30pm and 8.30pm.  \r\n\r\n','Event Sold Out','longbarsandersonhotel.jpg',0,0),(6,'2010-09-18','Mortons','Dinner Party','London','28 Berkeley Square','','Mayfair','W1J 6EN','28','8.00',65,'Please join us for our monthly dinner party at Morton\'s, an impressive Georgian townhouse spanning over four floors with striking views over Berkeley Square. We will enjoy 2 courses with wine before we head downstairs for dancing until late. Don\'t miss out on this night - limited spaces available.','Event Sold Out','mortons0.jpg',0,0),(7,'2010-10-01','Circus','Dinner Party','London','27 - 29 Endell Street','','Covent Garden','WC2H 9BA ','28','7.00',65,'Please join us for a fun-filled dinner party at the totally stylish Circus restaurant in London\'s Covent Garden.Interior designer of the moment Tom Dixon, has put together the breathtaking interior which gives one the impression of a medieval banquet shot in to the 25th century. Socialise and network with other single professionals in London.','Event Sold Out','circus.jpg',0,0),(8,'2011-02-17','Cavalli Lounge','Launch Party','Dubai','Fairmont Hotel  ','Sheikh Zayed Road','','Dubai','28','8.00',15,'Please join us for the launch of Dubai Dinner Club at Cavalli Club in the stunning Fairmont Hotel in Dubai. Designed by renowned designer Roberto Cavalli, this is the perfect venue to bring together like-minded professionals from all over the world for business and social networking. Don\'t miss this - limited spaces available.','Available','cavalliclub.jpg',29,30),(14,'2011-01-22','Mortons','Dinner Party','London','28 Berkeley Square','','Mayfair','W1J 6EN','28','8.00',70,'Please join us for our monthly dinner party at Mortons, an exclusive Private Member\'s Club in Mayfair. We will enjoy 2 courses with wine before we continue the evening with more socialising in the bar and Night Lounge. This is a great opportunity to meet other single professionals in London over great food and wine in a stunning environment - don\'t miss out.','Female Tickets Sold Out','mortons3.jpg',9,0),(15,'2011-02-24','Mortons','Dinner Party','London','28 Berkeley Square','','Mayfair','W1J 6EN','28','8.00',70,'Please join us for our monthly dinner party at Mortons, an exclusive Private Member\'s Club in Mayfair. We will enjoy 2 courses with wine before we continue the evening with more socialising in the bar. This is a great opportunity to meet other single professionals in London over great food and wine - limited spaces available.','Female Tickets Sold Out','mortons4.jpg',10,0),(10,'2010-11-25','Home House ','Thanksgiving Dinner','London','20 Portman Square','','London','W1H 6LW','28','8.00',65,'Please join us for a special Thanksgiving Dinner at this exclusive Private Member\'s Club, Home House. This is a great opportunity to socialise and network with other single Professionals in London so don\'t miss out!','Female Tickets Sold Out','homehousethanksgivingdinner.jpg',5,0),(9,'2010-11-11','Mortons','Dinner Party','London','28 Berkeley Square','','Mayfair','W1J 6EN','28','8.00',65,'Please join us for our monthly dinner party at Morton\'s, an impressive Georgian townhouse spanning over four floors with striking views over Berkeley Square. We will enjoy 2 courses with wine before we head to the bar for more socialising. Don\'t miss out on this night - limited spaces available.','Event Sold Out','mortons1.jpg',0,0),(12,'2011-01-13','Mortons','Dinner Party','London','28 Berkeley Square','','Mayfair','W1J 6EN','28','8.00',70,'Please join us for our monthly dinner party at Mortons, an exclusive Private Member\'s Club in Mayfair. We will enjoy 2 courses with wine before we continue the evening with more socialising in the bar. This is a great opportunity to meet other single professionals in London over great food and wine - limited spaces available.','Female Tickets Sold Out','mortons2.jpg',4,0),(13,'2011-01-18','Home House','Dinner Party','London','20 Portman Square','','London','W1H 6LW','28','7.45',55,'For those of you who miss the apres ski atmosphere, please join us at Home House for delicious Swiss Cheese Fondue evening. This was a real success last year so please book early if you would like to join us.','Female Tickets Sold Out','homehouse3.jpg',6,0),(20,'2011-04-20','The Avenue, Mayfair','Dinner Party','London','7-9 St James\'s Street','','Mayfair','SW1A 1EE ','28','7.45',65,'Please join us for dinner at The Avenue, a beautifully minimalist restaurant with a buzzing cosmopolitan atmosphere. Just a short walk from Green Park, close to the Royal Academy of Arts. Avenueâ€™s Head Chef Mikko Kataja, formerly of Launceston Place, offers a modern British menu that showcases seasonal ingredients. WE will enjoy 2 courses with a glass of champagne so don\'t miss out on this evening of socialising and networking over great food.','Available','theavenuemayfair.jpg',10,10),(11,'2010-12-19','Home House','Christmas Lunch','London','20 Portman Square','','Londnon','W1H 6LW','28','1.00',55,'Please join us for a traditional Sunday Lunch at this exclusive Private Member\'s Club in London. Socialise and network over great food and wine on the lead up to Christmas! Book early to avoid disappointment.','Female Tickets Sold Out','homehouse2.jpg',7,0),(16,'2011-02-13','Caramel Bar Lounge','Networking Drinks','Dubai','DIFC, Building 3, Second Floor','','Dubai','DB','28','7.30',15,'The first drinks event in Dubai will be at Caramel, a new restaurant and Lounge Bar which brings new level of opulance to the already glamorous Dubai social life! We hope you can join us for drinks to socialise and network.\r\n\r\n','Available','caramelbarlounge.jpg',10,10),(17,'2011-02-15','Zuma','Dinner Party','Dubai','Sheikh Zayed Road','','Dubai','DB','28','7.30',70,'If you love Zuma in London, you will absolutelu adore the one in Dubai.Exquisite food, decor, ambience...don\'t miss out on our dinner party. A great way to socialise and network over outstanding food.','Available','zuma0.jpg',10,10),(18,'2011-03-11','Asia De Cuba','Dinner Party','London','45 St Martin\'s Lane','','London','WC2N 4HX','28','8.00',70,'With vibrant and sleek design, Asia de Cuba is housed in the chic 5-star St. Martin\'s Lane hotel in London\'s West End. Drawing in a trendy crowd, the fusion of Cuban and Asian cuisine and the Starck-designed interior, our dinner party here is not to be missed! Limited places available.','Female Tickets Sold Out','asiadecuba.jpg',8,0),(19,'2011-04-07','Collection','Dinner Party','London','264 Brompton Road','','South Kensington','SW3 2AS','28','8.00',65,'Please join us for our monthly dinner party at this stylish restaurant and bar. We will enjoy 3 courses and a glass of wine. Those familiar with our dinner parties will know they are informal and fun and we all move after each course. Don\'t miss this opportunity to meet other single  professionals in London.','Event Sold Out','collection.jpg',0,0),(29,'2011-11-03','Mango Tree','Dinner Party','London','46 Grosvenor Place','','Belgravia','SW1X 7EQ ','28','8.00',75,'Please join us for dinner at this amazing Thai restaurant, a sleek, spacious, award-winning eatery a stone\'s throw from Buckingham Palace. We will injoy 2 courses with wine before we continue the evening with more socialising at the bar. Limited spaces available.','Female Tickets Sold Out','mangotree.jpg',9,0),(21,'2011-06-07','W Hotel','Dinner Party','London','10 Wardour Street','','London','W1D 6QF','28','7.30',70,'This chic and stylish hotel has a South Asian restaurant which is run by three-Michelin starred chef Jean-Georges Vongerichten. We will enjoy 2 courses with a glass of wine before we move on to the first floor bar to continue socialising.','Female Tickets Sold Out','whotel.jpg',8,0),(30,'2011-12-01','Palm Beach Casino','Networking Drinks','London','30 Berkeley Street','','Mayfair','W1J 8EH','28','7.45',40,'Please join us for wine and canapes at the newly refurbished Palm Beach Casino in Mayfair. This is a great opportunity to meet other members and to socialise and network so please don\'t miss this evening.','Female Tickets Sold Out','palmbeachcasino.jpg',11,0),(22,'2011-06-15','Mortons','Dinner Party','London','28 Berkeley Street','','Mayfair','W1J 6AH','28','7.45',75,'We would love you to join us at Mortons, an exclusive Private Member\'s Club in Mayfair. We will enjoy 2 courses with wine before we continue the evening socialising in the bar/Night Lounge. This venue attracts a stylish and fun crowd so please don\'t leave it too long to book your space as they are limited.','Female Tickets Sold Out','mortons5.jpg',8,0),(23,'2011-07-12','China Tang @ Dorchester Hotel','Dinner Party','London',' The Dorchester Hotel ','Park Lane ','London','W1A 2HJ','28','8.00',75,'Our Summer dinner party will be held at the stylish Dorchester Hotel in Park Lane. China Tang is \"luxe\" Chinese cuisineand is a real experience for the food as well as the ambience.This is definitely a place for celebrity spotting too. We will enjoy 2 courses with a drink here before we move to the bar for more socialising and networking. Limited spaces available so book early. ','Female Tickets Sold Out','chinatangdorchesterhotel.jpg',9,0),(28,'2011-10-05','Momos','Dinner Party','London','25 - 27 Heddon Street','','London','W1B 4BH ','28','7.45',75,'Momos is a fashionable moroccan restaurant with a souk-style ambiance in London\'s West End. COme and join us for dinner and socialise and network with other like-minded professionals. Limited spaces available.','Female Tickets Sold Out','momos.jpg',9,0),(24,'2011-09-15','Awana','Dinner Party','London','85 Sloane Avenue','','Chelsea','SW3 3DX ','28','7.45',75,'Holding the title for London\'s finest Malaysian experience, this month\'s dinner party will sample some of their favourite dishes. This is a great way to socialise and network with other single professionals in London so don\'t miss out.','Female Tickets Sold Out','thebotanist.jpg',1,0),(25,'2011-10-13','La Brasserie','Dinner Party','London','272 Brompton Road','','Chelsea','SW3 2AW','28','8.00',70,'There are some restaurants which London simply couldnâ€™t be without and Chelseaâ€™s La Brasserie is one of the few. For almost 40 years, La Brasserie has brought true French charm to the capital with its authentic Gallic menu and its atypical Parisian look. We will enjoy 2 course with wine and will continue the evening next door at stylish Collection Bar for further drinks and socialising','Event Sold Out','labrasserie.jpg',0,0),(26,'2011-11-10','China Tang','Dinner Party','London','Dorchester Hotel','57 Park Lane','','W1A 2HJ','28','8.00',75,'It\'s always a special treat to return to the Dorchester Hotel\'s China Tang restaurant. Such amazing \"luxe\" Chinese food and fabulous Art Deco restaurant creates the perfect setting for a gret dinner party. Hoping you can join us here. Limited spaces available.','Female Tickets Sold Out','chinatang.jpg',5,0),(27,'2011-07-19','Haris Salon, Chelsea','Networking Drinks','London','233 Kings Road','',' Chelsea','SW3 5EJ','28','7.30',30,'On the evening of 19th July London Dinner Club will be hosting a special evening of \'dating with confidence\' alongside Haris Salon, Kings road, Chelsea. It will be a soiree of beauty treats, cupcakes from Harrods, bubbles and cocktails for the female members of London Dinner Club.The night includes hair advice from Dar, celebrity hairstylist, clients include Goldie Hawn, Jemima Khan, many Bollywood actresses and Royal families across the Asia Pacific.He will be advising you on how to make yourself look the best for your date or for a dating event. Make-up artists from Becca Cosmetics will demonstrate how changes to your make up can transform your look to give you more confidence. Limited spaces available.','Available','harissalonchelsea.jpg',0,25),(31,'2011-11-24','Le Caprice','Thanksgiving Dinner','London','Arlington Street','','London','SW1A 1RJ','28','8.15',75,'Please join us for a traditional Thanksgiving dinner at Le Caprice, the legendary chic restaurant in exclusive St James. We will enjoy 2 courses with wine so please book early to avoid disappointment.','Event Sold Out','lecaprice.jpg',0,0),(39,'2012-10-26','Zuma','Dinner Party','Dubai','Gate Village 06','DIFC ','Dubai','506620','26 - 42','9.30',80,'We are excited to be hosting our first dinner party in Dubai at Zuma, a sophisticated yet informal Japanese restaurant situated in the Dubai International Financial Centre. A great opportunity to network and socialise over great food.Ticket price includes food only (AED 450 approx)','Available','zuma.jpg',8,7),(32,'2012-01-18','China Tang','Dinner Party','London','Dorchester Hotel','52 Park Lane','Mayfair','W1K 1QA','28','8.00',75,'We return to China Tang, a favourite with our members not only for the \"luxe\" Chinese cuisine but also for the amazing cocktails made by the barman! We will enjoy a selection of the restaurant\'s speciality dishes before we continue the evening socialising at the bar. Don\'t miss this evening. Price includes 1 drink.','Female Tickets Sold Out','chinatang0.jpg',6,0),(33,'2012-02-11','Apres Bar','Networking Drinks','London','31 Duke Street','','Marylebone','W1U 1LG','28','7.30',40,'Hoping you can join us for pre Valentine\'s drinks at Apres Bar in Marylebone. This is a great opportunity for our members to socialise and network over wine and canapes so don\'t miss out. Ticket price includes a glass of wine and canapes.','Female Tickets Sold Out','palmbeachcasino0.jpg',14,0),(34,'2012-03-14','China Tang','Dinner Party','London','Dorchester Hotel','53 Park Lane','','W1K 1QA','28','7.45',75,'A favourite with our members, China Tang offers luxe chinese food in glamorous settings. We will enjoy a selection of their speciality dishes and a glass of wine before we continue the evening in the bar. ','Female Tickets Sold Out','chinatang1.jpg',5,0),(35,'2012-04-18','La Brasserie, Chelsea','Dinner Party','London','272 Brompton Road','','Chelsea','SW32AW','28','7.30',70,'After a successful dinner party here in 2011, we return to this iconic Chelsea restaurant which combine great French food with a buzzing atmosphere. 3 courses plus a glass of wine is included in the price. Limited spaces available.','Female Tickets Sold Out','labrasseriechelsea.jpg',6,0),(41,'2012-12-06','Harvey Nichols Fifth Floor','Dinner Party','London','Harvey Nichols Fifth Floor','Seasons restaurant','Knightsbridge','Sw1','26 - 42','8.00',70,'Please join us for our end-of-year dinner party at the stylish Seasons restaurant at Harvey Nichols Fifth Floor. We will enjoy great food and wine so don\'t miss this evening to network and socialise.','Female Tickets Sold Out','harveynicholsfifthfloor.jpg',5,0),(38,'2012-10-25','Jetty Lounge Bar, Royal Mirage Hotel','Networking Drinks','Dubai',' Al Sufouh Road,','Jumeirah Beach ','Dubai','37252','26 - 42','9.00',35,'Please join us for our networking drinks evening in Dubai at the stunning Jetty Lounge Bar at the One & Only Royal Mirage Hotel in Dubai. This is a great opportunity to meet other professionals over informal drinks at this exceptional venue. Ticket price (AED 200 approx) includes unlimited wine, beer and soft drinks from 9pm-11pm.','Available','jettyloungebarroyalmiragehotel.jpg',20,20),(36,'2012-07-19','Mortons, Mayfair','Networking Drinks','London','28 Berkeley Square','','Mayfair','W1J 6AH','28','7.00',25,'Please join us for our Networking drinks at this exclusive Private members club in the heart of Mayfair. A stylish venue to socialise and network with other single professionals in London. A complimentary cocktail on arrival is included.','Available','