INSERT INTO `LoveItems` VALUES (2,'Pret-A-Portea','The Berkeley Hotel has partnered with Thomas Goode of Mayfair to produce a bespoke collection of Paul Smith fine bone china for its exclusive \"Pret-A-Portea\" afternoon tea experience. Served in the Caramel Room at The Berkeley Hotel from 1-6pm every day. Â£36.50pp','http://www.the-berkeley.co.uk/?utm_source=google&utm_medium=ppc&utm_campaign=travelclick',''),(1,'Hari Salon - Chelsea','We were so impressed with Hari Salon on Kings Road Chelsea, we just had to share this with you. Our favourite hair stylist, Dar, will give you an amazing cut and blow dry that will have you taking compliments for weeks after. Yes, he is a celebrity hairstylist but we left the Salon that da feeling like a celebrity too!','http://www.harissalon.com/','201112270.jpg'),(3,'Novikov','One of London\'s most anticiapted restaurant opening, Novikov Restaurant will launch in Nov 2011. This will be the first restaurant outside Russia for the Group and will be located in the heart of Mayfair. There will be 2 restaurants: once specialising in Asian food and the other classic Italian','http://www.novikovrestaurant.co.uk',''),(4,'Harrods Ice cream Parlour','Harrods have launched a new Ice Cream Parlour and Juice bar - located onb the Second Floor of harrods. Flavours include Hot Fudge Sundae, our favourite!','http://www.harrods.com',''),(5,'Executive coaching','Farzana Velji is a licensed practitioner of psychometric tools - Myers Briggs Type Indicator and FIRO-B - both of which help to develop rapport and awareness effortlessly, projecting greater personal awareness and insight of others\' perspectives as you move into a new realm of possibilities.<br/><br/>She works with diplomats, executives, businesses and private individuals.  Coaching offers the opportunity to focus on a goal with an experienced professional working closely with you to bring you to clarity and success.  She coaches individuals on a plethora of issues using a heady combination of coaching techniques, psychometrics and pure insight to make changes, move forward and achieve results in an incredibly short space of time. <br/><br/>She is offering London Dinner Club members a very special rate.<br/><br/>Please contact her directly on 07805 803233 or farzanavelji@gmail.com','http://www.linkedin.com/profile/view?id=84799350&trk=hb_tab_pro_top','20130331.jpg');
