INSERT INTO `Press` VALUES (1,'2011-08-24','Matchmaker','Lovely piece in City AM highlight ex-investment banker Salima Manji setting up a Singles Supper Club to help City workers meet like-minded single professionals in upmarket surroundings.','Climbing the career ladder by working long hours \"can get lonely\" emhathises former investment banker Salima Manji who set up London Dinner Club to help City workers meet like-minded single professionals in upmarket surroundings.<br/>\"Many people don\'t have the time to meet people as they have extremely demanding jobs\" said the ex-Credit Suisse and JP Morgan employee. \"This leaves them wondering where to go to meet people\" Look no further than the next \"intimate soiree\" at Awana in SLoan Sq on 15th Sept.','http://www.cityam.com/the-capitalist/harriet-dennys/taxi-tycoon-returns-foot-messengers-square-mile-streets ','20110824.gif'),(2,'2011-08-26','Top Cities for Singletons','Loved-up couples can keep Paris and Rome - our dating expert has picked 10 urban hotspots where even the most pessimistic solo traveller will be spoilt for choice. We can\'t guarantee you\'ll meet the love of your life in any of these places, but then again, that\'s not what single life is about. There is, however, every chance you\'ll have a stupendous amount of fun. From the party hub of Tel Aviv to the surprisingly date-primed city of Austin, we reveal the best cities for singletons - tell us if you have any handy tips to share! \r\n\r\n\r\n\r\n\r\n\r\n','London is finally catching up to the US in the dating frenzy, with new dating services launching every day. The latest is the London Dinner Club - an upmarket dating service for successful single professionals. If all that sounds like too much bother, head to singles hangouts Shoreditch - boho and cutting-edge bars - or Soho - champagne and cocktail heaven.<br/><br/>','http://travel.uk.msn.com/travel-advice/top-cities-for-singletons?cp-documentid=158948994&page=10','20110826.jpg'),(3,'2012-08-16','E-Financial News','Article called \"Life After The City\" about how Salima Manji, founder of London Dinner Club, left her career in Investment Banking to set up a Supper Club for single professionals','Salima worked at various investment banks including Credit Suisse and JP Morgan before leaving the City in 2008. She wanted to work for herself, doing something she enjoyed. London Dinner Club has been her great passion for almost five years now.','','20120816.jpg'),(4,'2013-03-02','Financial World','Two page feature on Salima Manji and her businesses London Dinner Club and Asian Dinner Club.','Salima\'s move from Investment Banking to playing Cupid is documented in this thus article.','','20130302.jpg'),(5,'2013-02-10','Fulham Residents Magazine','Dinner Date - a one page feature in this local magazine about Supper Club for Singles, London Dinner Club.','Dinner parties hosted at upmarket restaurants such as China Tang at Dorchester Hotel, Nobu and Coya in Mayfair.','','20130210.jpg'),(6,'2013-02-08','Fulham Chronicle Feb 2013','Salima Manji, a resident in Fulham, talks about Asian Dinner Club and London Dinner Club.','Outlines of typical day as an events organiser, compared to her past life as an Investment Banker.<br/>','','20130208.jpg');
